}

int PASCAL WinMain(HINSTANCE hInstance, HINSTANCE hPrevInstance, LPSTR lpCmdLine, int nCmdShow)
{
    HWAVEOUT hout;
	PCMWAVEFORMAT format;
    int result;
    FARPROC callback;

    callback = MakeProcInstance((FARPROC)waveOutProc, hInstance);
    if (callback == NULL)
    {
        error("MakeProcInstance failed");
    }

	if ((result = waveOutOpen(&hout, WAVE_MAPPER, (LPWAVEFORMAT)&format, (DWORD)callback, 0, CALLBACK_FUNCTION)) != MMSYSERR_NOERROR)
    {
        char errorMsg[256];
        waveOutGetErrorText(result, errorMsg, sizeof(errorMsg));
        error(errorMsg);
	}
    error("Success");
	return 0;
}

