//Vowel Remover Helper Function
function vowelRemover(word){
    let vowels = "aeiou";
    let wordSplit = word.split("");

    for(let i = 0; i < wordSplit.length; i++){
        let currentValue = wordSplit[i];
        
        if(vowels.includes(currentValue)){
            wordSplit.splice(i, 1);
            i--;
        }
    }
    wordSplit = wordSplit.join("")
    return wordSplit;
}

