//Good implementation. When removing the vowels from the word, it isn't necessary to split the word into an array. In JS strings are iterable
function abbreviate(sentence){
    let sentenceArray = sentence.split(" ");
    let newSentence = []

    for(let i = 0; i < sentenceArray.length; i++){
        let currentWord = sentenceArray[i];
        
        if(currentWord.length > 4){
            newSentence.push(vowelRemover(currentWord));
        }
        else{
            newSentence.push(currentWord);
        }
    }

    newSentence = newSentence.join(" ");
    return newSentence;
}

//Vowel Remover Helper Function
function vowelRemover(word){
    let vowels = "aeiou";
    let wordWithoutVowels = "";

    for(let i = 0; i < word.length; i++){
        let currentChar = word[i];

        if(!vowels.includes(currentChar)){
            wordWithoutVowels += currentChar;
        }
    }
    
    return wordWithoutVowels;
}

