function oscars(input) {
  let name = input[0];
  let points = parseFloat(input[1]);
  let numJudges = parseInt(input[2]);

  for (let i = 3; i < 3 + numJudges * 2; i += 2) {
    let judgeName = input[i];
    let judgeScore = parseFloat(input[i+1]);
    points += ((judgeName.length * judgeScore) / 2 )
    if (points >= 1250.50) {
      console.log(`Congratulations, ${name} got a nominee for leading role with ${points.toFixed(1)}!`);
      break;
    }  
  }
 
  let diff = 1250.50 - points
  if (diff > 0) { 
    console.log(`Sorry, ${name} you need ${(diff).toFixed(1)} more!`)
  }
}

